import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

const background = () => {
    return (

    <MDBContainer>
      <MDBRow>
        <MDBCol className="text-center">
          <img src="/Assets/sofiya-copy2.jpg" alt="sofiya"></img>
        </MDBCol>

      </MDBRow>
      <MDBRow>
        <MDBCol className="text-center">
          <p>
          </p>
        </MDBCol>

      </MDBRow>
    </MDBContainer>

        );
    }

export default background;
